	[7388] = {
		Title = "Maries's Child",
		Description = {
			"Let's find the ^4d4dffInside-out Shirt^000000 for Maries's child who is lost in the woods. The shirt must be taken by an animal or a monster."
		},
		Summary = ""
	},
	[7389] = {
		Title = "Give the Shirt to Maries's Child",
		Description = {
			"Gave the shirt to Maries's child. The child will wear the shirt and go home safely. I'll have to let Maries know that everything is alright now."
		},
		Summary = ""
	},
	[7390] = {
		Title = "Worried about Maries's Child",
		Description = {
			"From the child's story, it looks like there is a mischievous spirit that fools people into losing their way. This mean the child might get lost again. If you are worried, stop by their place again."
		},
		Summary = ""
	},
	[7391] = {
		Title = "Jejeling and Jejellopy",
		Description = {
			"Collection Dealer, Woeon, collects Jejellopys and asked you to help collect them. Hunt down Jejelings nearby and collect the Jejellopys they drop. Deliver 30 Jejellopys to Woeon."
		},
		Summary = "Deliver 30 Jejellopys to Woeon"
	},
	[7392] = {
		Title = "Collect Jejellopy Regularly",
		Description = {
			"Jejellopy is manufactured to use as material in various products. Woeon will need as many Jejellopys as he can get. Let's visit him when I have spare time."
		},
		Summary = ""
	},
	[7393] = {
		Title = "Shiny Silver Blade",
		Description = {
			"Cub Blacksmith, Pandoi's dream is to make a Silver Blade weapon. Collect 10 Silver Bracelets from monsters in the hospital."
		},
		Summary = "10 Silver Bracelets, and Defeat Manananggal and Tiyanak"
	},
	[7394] = {
		Title = "Shiny Tomorrow",
		Description = {
			"Go back to Pandoi after a day. If he failed to create a Silver Blade, then he will need your help to get more Silver Bracelets."
		},
		Summary = ""
	},
	[7395] = {
		Title = "Ghost on the Perry Ship",
		Description = {
			"Decided to see for yourself if Pedro's story that the Perry Ship is haunted is true. Ghosts around here seem to be afraid of me so let's not be afraid to board the ship."
		},
		Summary = "Investigate the Perry Ship."
	},
	[7396] = {
		Title = "Angry Soul on Perry Ship",
		Description = {
			"Was treated badly in the Perry Ship by an angry girl spirit. Let's look for a solution."
		},
		Summary = "Talk to Pedro and Mumbaki."
	},
	[7397] = {
		Title = "Mumbaki Phong's Advice",
		Description = {
			"Mumbaki Phong said not to avoid the spirit but to embrace and soothe it. Let's look for flowers to offer. You can get flowers from the animals and monsters nearby."
		},
		Summary = "3 Elegant Flowers, 3 Mysterious Flowers, 3 Beautiful Flowers"
	},
	[7398] = {
		Title = "Offering Bouquet Recommended by Mumbaki",
		Description = {
			"Mumbaki Phong blessed the flowers and made an Offering Bouquet you've brought to him. Let's take this bouquet to Soul Diwata on the Perry Ship."
		},
		Summary = "Offer the Bouquet to Diwata."
	},
	[7399] = {
		Title = "Soul Diwata's Story",
		Description = {
			"Diwata said she was bullied by native ghosts because she was from outside of the village. Perry Ship is stuck because Diwata's powerful soul."
		},
		Summary = "Share this information with Pedro."
	},
	[7400] = { Title = "Mumbaki of Port Malaya", Description = { "" }, Summary = "" },
	[7401] = {
		Title = "All Aboard for Perry Sailing",
		Description = {
			"Looks like the Perry Ship can operate regularly for the time being. But let's check up on the ship after a day. There still is a chance of native ghosts bullying Diwata."
		},
		Summary = ""
	},
	[7402] = {
		Title = "Bouquet for Diwata",
		Description = {
			"Decided to create a bouquet to calm Diwata from her fight with the native ghosts. Gather flowers for Mumbaki Phong to bless."
		},
		Summary = "3 Elegant Flowers, 3 Mysterious Flowers, 3 Beautiful Flowers"
	},
	[7403] = {
		Title = "Stabilized Perry",
		Description = {
			"Diwata calmed down after receiving the bouquet. The Perry Ship can start sailing again. Let's tell Pedro."
		},
		Summary = ""
	},
	[7404] = {
		Title = "Get Rid of Jejeling",
		Description = {
			"Decided to help some peddlers traveling to and from Baryo to eliminate Jejelings. Try to get rid of 20 Jejelings today."
		},
		Summary = "20 Jejelings"
	},
	[7405] = {
		Title = "Get Rid of Jejeling - Same Time Tomorrow",
		Description = {
			"Getting rid of Jejelings is an ongoing project that needs lots of help. To participate, meet the Guard after a day."
		},
		Summary = ""
	},
	[7406] = {
		Title = "Agree to Collecting Bones!",
		Description = {
			"Collect bones for the guard dog Vantai. Collected bones must be purified. Take the collected Evil Spirit Bones to Mumbaki Kiko to purify them."
		},
		Summary = "10 Evil Spirit Bones, 10 Holy Water"
	},
	[7407] = {
		Title = "Purified Bone",
		Description = {
			"Received Purified Spirit Bones after Mumbaki Kiko's ritual. Let's take them to Quarter."
		},
		Summary = "Deliver 10 Purified Spirit Bones to Quarter10."
	},
	[7408] = {
		Title = "Agree to Come Back Tomorrow?",
		Description = {
			"Guard Quarter of Baryo Mahiwaga would like to have more bones to give Vantai tomorrow. Let's visit again after a day."
		},
		Summary = ""
	},
	[7409] = {
		Title = "Cannot Meet Eyes with Him!",
		Description = {
			"Self-claimed Good Capre Budidai cannot bear to see his friends being bullied by the Bungisngis. Bungisngis was too powerful for Budidai to handle and now he is asking if you can help him take care of the one-eyed monster."
		},
		Summary = "Get Rid of 10 Bungisngis"
	},
	[7410] = {
		Title = "Teach Another Lesson Tomorrow!",
		Description = {
			"Capre Budidai said the Bongisungisu won't go away from one scare and asks to continue threatening them. Come back after a day."
		},
		Summary = ""
	},
	[7411] = {
		Title = "The traveler, Fome's story",
		Description = { "Listened to the story regarding the Laphines and Eclage." },
		Summary = ""
	},
	[7412] = {
		Title = "The traveler, Litrip's story",
		Description = { "Listened to the story regarding Bifrost Tower." },
		Summary = ""
	},
	[7413] = {
		Title = "The traveler, Chiba's story",
		Description = { "Listened to the Laphines' organization and roles." },
		Summary = ""
	},
	[7414] = {
		Title = "Eclage guard's message",
		Description = {
			"Someone from Eclage wanted to meet. Ask for directions from the guard near the east exit of the Eclage plaza."
		},
		Summary = "Talking with the guard at the east exit of Eclage."
	},
	[7415] = {
		Title = "Laphine's Chief of Staff",
		Description = {
			"Planned to meet someone based on the instructions from the Eclage guard. If lost, ask for directions from the guard again."
		},
		Summary = "Talking with the chief of staff."
	},
	[7416] = {
		Title = "Waiting to meet",
		Description = {
			"After talking with the chief of staff, requested to meet with King of Laphines Mayor Jun. Once the wait is over, let's ask the Eclage guard again for more directions."
		},
		Summary = "Asking for directions after waiting."
	},
	[7417] = {
		Title = "Kardui's request",
		Description = {
			"Mayor Jun did not listen to my sincere stories, but instead stated that he would listen to more of it if I were to contribute to Eclage more significantly. Let's take care of the Laphines in Eclage that need help."
		},
		Summary = "Working for Eclage."
	},
	[7418] = {
		Title = "For Eclage 1",
		Description = {
			"Obtain ingredients to decorate Yai for the Eclage guard who is too busy. Horns of Hillslion, Mystic Horns, Horse's Hooves, 5 of each, would be sufficient."
		},
		Summary = "5 Horns of Hillslion, 5 Mystic Horns, 5 Horse's Hooves."
	},
	[7419] = {
		Title = "For Eclage 2",
		Description = {
			"Decided to deliver mails from Splendide Contact Officer as a favor for Roy the messenger who was having trouble at the edge of Bifrost due to communications getting cut off."
		},
		Summary = "Splendide Contact Officer and Mailbox."
	},
	[7420] = {
		Title = "For Eclage 3",
		Description = {
			"For Leo who loves sweets, get him Splendide-made Pinguicula's Pickled Fruits and Luciola's Honey Jam. Pickled fruits and honey jam can be obtained using coins at the advanced base."
		},
		Summary = "3 Pinguicula's Pickled Fruits, 3 Luciola's Honey Jam."
	},
	[7421] = {
		Title = "That's enough",
		Description = {
			"While working on various jobs, Kardui's page reached me. Must go and meet Kardui. His office will be on the top floor when following the spiral road."
		},
		Summary = "Talking with Kardui."
	},
	[7422] = {
		Title = "Kardui's gift",
		Description = {
			"Kardui stated that he prepared a gift that can be picked up from Chief of Staff Shenime. What could it be.."
		},
		Summary = "Receiving the gift through Shenime."
	},
	[7423] = {
		Title = "A rumor about the King 1",
		Description = {
			"During the conversation with Leo, unsettling things about Kardui were told. He didn't seem to get into the details but it was very concerning. "
		},
		Summary = ""
	},
	[7424] = {
		Title = "A rumor about the King 2",
		Description = {
			"Fome shared something unexpected. It was that Laphines have been subtly disliking Kardui. This was similar to what Leo seemed to keep to himself before."
		},
		Summary = ""
	},
	[7425] = {
		Title = "A rumor about the King 3",
		Description = {
			"Connection between Cenes's despotism and Kardui was made through talking with the Laphines. It is not too serious, but it is certain that the current king Kardui is being considered in a way similar to how Cenes was."
		},
		Summary = ""
	},
	[7426] = {
		Title = "A rumor about the King 4",
		Description = {
			"Most recently, Kardui seemed to have become Mayor Jun in the midst of the calamity facing the entire Laphine race. They don't seem to completely disagree with his policies, but they don't seem to agree with them either."
		},
		Summary = ""
	},
	[7427] = {
		Title = "At times like this, face it straight on!",
		Description = {
			"The truth behind Laphine's anxiety and fear toward Kardui could no longer be elucidated. Shouldn't this at least be communicated to the individual of interest? It might be possible to hear about the reason behind it all.."
		},
		Summary = "Talk with Kardui."
	},
	[7428] = {
		Title = "Yai of the wild",
		Description = {
			"Obtain items for the Yai for the Eclage guard Minuel who stands post every day and night."
		},
		Summary = "10 Horns of Hillslion, 10 Mystic Horns, 10 Horse Hooves."
	},
	[7429] = {
		Title = "Wild recent trend!",
		Description = {
			"The items collected by Minuel seemed to have created a sensation among the Yai decorations. Let's obtain the times regularly to keep the trend going."
		},
		Summary = "Check with Minuel after some time."
	},
	[7430] = {
		Title = "Deliveryman that runs through space",
		Description = {
			"Delivered mails from Splendide in place of Roy who is still having trouble at the edge of Bifrost."
		},
		Summary = "Splendide Contact Office, Mailbox."
	},
	[7431] = {
		Title = "A mailman never rests!",
		Description = { "Mails require regular deliveries. Let's check again later." },
		Summary = "Check with Roy after some time."
	},
	[7432] = {
		Title = "The troublemakers in the land of blooming flowers",
		Description = {
			"Let's show who's boss to Menblatt and Petals that annoy travelers. It's reported as patrolling, but it's actually elimination."
		},
		Summary = "Eliminating Menblatt and Petals. "
	},
	[7433] = {
		Title = "Need constant guidance",
		Description = {
			"Leo once again asks to patrol and subjugate the Menblatt and Petals. Let's check with him later."
		},
		Summary = "Check with Leo after some time."
	},
	[7434] = {
		Title = "Kardui's big brother",
		Description = {
			"Kardui sends a letter to his big brother. Kardui's brother lives on the top flower of Biforst Tower. Let's deliver it to him."
		},
		Summary = "Deliver the letter."
	},
	[7435] = {
		Title = "Time for reading the letter",
		Description = {
			"Hisie asked for some time to read the letter. It only takes a couple of minutes, so let's wait a bit."
		},
		Summary = "Wait until he is done reading the letter."
	},
	[7436] = {
		Title = " Avant the Scholar of Magics",
		Description = {
			"In Kardui's letter, there was not only an introduction but also a request to look for his father, Avant the Scholar of Magics. Help Hisie to find out more about the scholar from within Eclage."
		},
		Summary = ""
	},
	[7437] = {
		Title = "Shenime's favor",
		Description = {
			"Could not obtain Avant's info but instead got a strange request from Shenime. Asked to gather experimental ingredients for the scholar of magics he sponsors. They are 10 Dust Balls, 10 Leaf Bookmarks."
		},
		Summary = "10 Dust Balls, 10 Leaf Bookmarks."
	},
	[7438] = {
		Title = "Secret sponsorship",
		Description = {
			"Shenime did not share even a bit about the scholar of magics he sponsors, and asks to forget about even finding out about it. Is there anyone that knows?"
		},
		Summary = "Search for information."
	},
	[7439] = {
		Title = "The scholar of magics sponsored by Shenime",
		Description = {
			"Hisie stated that if you track down Shenime, the location of the scholar might be identified as well. Find out Shenime's duties."
		},
		Summary = "Search for information."
	},
	[7440] = {
		Title = "Minuel's witness",
		Description = {
			"Eclage guard Minuel stated that Shenime often travels east, in the opposite direction from his Yai. Discuss with Hisie."
		},
		Summary = "Talk with Hisie."
	},
	[7441] = {
		Title = "Mail is here!",
		Description = {
			"Planned to visit the scholar of magic's Yai as if Shenime is sending a mail. Hisie will confirm whether that person is Avant. Hisie will provide the information at the crossroads in front of Eclage."
		},
		Summary = "10 Dustballs, 10 Leaf Bookmarks"
	},
	[7442] = {
		Title = "The identity of the scholar of magics",
		Description = {
			"The scholar of magics found through the strategy was indeed Avant. Must tell this to Kardui."
		},
		Summary = "Talk with Kardui."
	},
	[7443] = {
		Title = "Interfere with the research!",
		Description = {
			"A small revenge. Kardui and Hisie want to know what Avant is researching and want to interfere it. Could this be a small revenge of the brothers?"
		},
		Summary = "Interfereing Avant's research."
	},
	[7444] = {
		Title = "What Avant was researching",
		Description = {
			"Avant was researching on the methods to extract the Orb's magic power. Since this is dangerous information, the research materials should immediately be returned to Kardui."
		},
		Summary = "Deliver the research materials to Kardui."
	},
	[7445] = {
		Title = "Avant's back",
		Description = {
			"Researched the force behind Avant's research on the Orb. The most likely culpril is Avant's sponsor, the chief of staff. Approach the chief of staff to reveal the truth."
		},
		Summary = "Talk with the chief of staff."
	},
	[7446] = {
		Title = "Unfruitful conversation",
		Description = {
			"Talked with Shenime the chief of staff, but nothing was gained. He states that he might also have been tricked by Avant. The chief of staff was actually upset that Kardui only increased the defenses surrounding the Orb."
		},
		Summary = "Report to Kardui."
	},
	[7447] = {
		Title = "Dilemma surrounding the Orb",
		Description = {
			"Only confirmed the distrust toward Kardui's instead of revealing more about Avant's research. The chief of staff hoped that Kardui's judgment has not weakened, and asked that he would demonstrate it."
		},
		Summary = "Report to Kardui."
	},
	[7448] = {
		Title = "Something's not right",
		Description = {
			"After discussing with Kardui and Hisie, it is decided that the chief of staff is indeed the most suspicious. What is the reason behind his resistance toward Kardui's actions toward the Orb?"
		},
		Summary = "Surveillance of the chief of staff."
	},
	[7449] = {
		Title = "Temptation toward the Orb",
		Description = {
			"The chief of staff asked to go to the Orb's lighting room to discuss it. I decided to let Kardui know about this after telling him to give me some time to think about it."
		},
		Summary = "Report to Kardui."
	},
	[7450] = {
		Title = "Orb's lighting room",
		Description = {
			"Not sure why the chief of staff kept trying to lure me into the Orb's lighting room, but decided to go there even just to figure out why. Let's go along with what he wants for now."
		},
		Summary = "Hold hands with the chief of staff."
	},
	[7451] = {
		Title = "Betrayal",
		Description = {
			"Everything is so confusing. The monster battled in the lighting room was not a subordinate of the King of Demons. They controlled me without my knowledge. Shenime the chief of staff betrayed all!"
		},
		Summary = "Report to Kardui."
	},
	[7452] = {
		Title = "Find the chief of staff!",
		Description = {
			"Shenime the chief of staff, who was responsible for all these occurrences, has hidden his whereabouts. According to Hisie's sources, residual magic force was faintly felt in Bifrost."
		},
		Summary = "Survey Northern Bifrost."
