	},
	[14122] = {
		Title = "Time for two",
		Description = {
			"Wuhari's letter was delivered to Wuhuru. He asked for some time to read the letter. Don't bother him when he's reading the letter."
		},
		Summary = "Give him time to read the letter."
	},
	[14123] = {
		Title = "Wuhuru's favor",
		Description = {
			"After reading his brother's letter, Wuhuru began to share his story extensively and asked to send his brother his regards. Go back to Wuhari and give him his brother's regards."
		},
		Summary = "Sending Wuhari regards."
	},
	[14125] = {
		Title = "Surveying the area",
		Description = {
			"Wuhari is searching for ways to recover Wuhuru's body. However, he doesn't know how. Wouldn't people in the nearby areas know something? Survey the areas nearby."
		},
		Summary = "Talk with people in the town."
	},
	[14126] = {
		Title = "Searching for Ms. Goatie",
		Description = {
			"Mr. Masione said he does not know much at all. But refers to Ms. Goatie who is a lot sharper with these things…"
		},
		Summary = "Search for Ms. Goatie."
	},
	[14127] = {
		Title = "Searching for Ms. Goatie's husband",
		Description = {
			"Ms. Goatie talked about how Wuhuru was very happy while shaking a piece of paper in the air. When asked about the paper, she said that her husband may know more about it."
		},
		Summary = "Search for Ms. Goatie's husband."
	},
	[14128] = {
		Title = "Obtaining the research report",
		Description = {
			"Mr. Svery who was always close with Wuhuru knew something more. Inside the letter that Wuhuru left before being taken to prison was the research report. Take it to Wuhari."
		},
		Summary = "Delivering the report."
	},
	[14131] = {
		Title = "Analysis time",
		Description = {
			"Wuhari received the report, but stated that it will take some time to analyze the report. Try talking to him a bit later. Don't bother someone when he is studying."
		},
		Summary = "Time for analysis."
	},
	[14133] = {
		Title = "Another favor",
		Description = {
			"Wuhari analyzed the research report, but he was still unsure about how to recover his brother's body. Try finding and asking the Laphine who originally requested Wuhuru's participation in research."
		},
		Summary = "Obtaining the evidence."
	},
	[14134] = {
		Title = "Sharp Ms. Goatie",
		Description = {
			"Although Mr. Svery was visited for more insight, he said that he has no idea about the high-level Laphine. However, he suggested seeing his wife who's sharp with these things."
		},
		Summary = "To Ms. Goatie."
	},
	[14135] = {
		Title = "Searching for Mr. Pompe",
		Description = {
			"When asked about the high-level Laphine's whereabouts, Ms. Goatie did not know much. However, a neighbor in town, Mr. Pompe, shared that he saw a Laphine in the field who later disappeared. Let's ask Mr. Pompe in more detail."
		},
		Summary = "Hearing the story from Mr. Pompe."
	},
	[14136] = {
		Title = "A terrible scene in the field",
		Description = {
			"Mr. Pompe is afraid of going out to the field. He talked about how a big corpse has been lying there ever since one high-level Laphine suffered a terrible death. Investigate the field."
		},
		Summary = "Field investigation."
	},
	[14137] = {
		Title = "An interesting proposition",
		Description = {
			"One Laphine girl made an interesting proposition. It seemed that the Laphine who gave Wuhuru the research report is the same person as her lost father. Let's look for him together."
		},
		Summary = "Field investigation."
	},
	[14138] = {
		Title = "The big corpse",
		Description = {
			"There was a big corpse that seemed to have been there a while. He was the Laphine that everyone has been looking for. We have to let the girl know this bad news."
		},
		Summary = "Report to Giranni."
	},
	[14139] = {
		Title = "To Wuhuru",
		Description = {
			"The girl confirmed that the corpse was her father's. I have to go back to Wuhari empty-handed since the Laphine of interest has died. Before that, let's go to Wuhuru to tell him about the Laphine he had worked with."
		},
		Summary = "To Wuhuru."
	},
	[14140] = {
		Title = "To Wuhari",
		Description = {
