	[63582] = {
		Title = "Episode Ragnarok",
		Description = {
			"Father Huntington of the Prontera Church is looking for adventurers for an expedition. Speak to him to join."
		},
		Summary = "Join the Expedition team."
	},
	[63583] = {
		Title = "Episode Ragnarok",
		Description = {
			"Father Huntington wants me to introduce myself to Paladin Liefa, I can see her standing behind Father Huntington inside of the Sanctuary."
		},
		Summary = "Speak with Liefa."
	},
	[63584] = {
		Title = "Episode Ragnarok",
		Description = {
			"I should get my things ready, then speak with Liefa again inside of the Sanctuary to embark on our expedition."
		},
		Summary = "Tell Liefa you're ready."
	},
	[63585] = {
		Title = "Episode Ragnarok",
		Description = {
			"Liefa wants to introduce me to Captain Muwuse and his brother Mowose, they'll be flying us to the frontier in their airship."
		},
		Summary = "Find Muwuse at Izlude Airport."
