		},
		Summary = "Speak to everyone."
	},
	[63594] = {
		Title = "Episode Ragnarok",
		Description = { "I spoke with Liefa, she's the Expedition leader, she seems nice." },
		Summary = "Speak to everyone."
	},
	[63595] = {
		Title = "Episode Ragnarok",
		Description = {
			"I spoke with Lief, Liefa's brother. It seems like everyone on this airhsip has been working together for a long time."
		},
		Summary = "Speak to everyone."
	},
	[63596] = {
		Title = "Episode Ragnarok",
		Description = { "Speak with Muwuse after landing in The Frozen Lands." },
		Summary = "Speak to Muwuse."
	},
	[63597] = {
		Title = "Episode Ragnarok",
		Description = {
			"Speak with Mowose after landing in The Frozen Lands. He might have something for me before I set off with Lief and Liefa."
		},
		Summary = "Speak to Mowose."
	},
	[63598] = {
		Title = "Episode Ragnarok",
		Description = {
			"It's time to embark on our expedition through the section of the frontier known as The Frozen Lands. Speak with Liefa when ready to begin."
		},
		Summary = "Speak to Liefa."
	},
	[63599] = {
		Title = "Episode Ragnarok",
		Description = {
			"It appears that we are to split up and travel to Tapte Stjerner separately. It was the main settlement village, north of the landing zone. There's a meeting point near the center of town that we are to meet at."
		},
		Summary = "Go north to Tapte Stjerner."
	},
	[63600] = {
		Title = "Episode Ragnarok",
		Description = {
			"We need to investigate what happened here. I'll probably learn the most from studying the remains of the villagers. I need to find 4 of the villagers remains in town then meet back with the others at the meeting point."
		},
		Summary = "Find the remains of 4 villagers."
	},
	[63601] = {
		Title = "Episode Ragnarok",
		Description = {
			"I found one of the villagers remains, once I find a total of four I'll have enough to put together what may have happened."
		},
		Summary = "Found 1 of the remains."
	},
	[63602] = {
		Title = "Episode Ragnarok",
