	[63605] = {
		Title = "Episode Ragnarok",
		Description = {
			"The village is a total loss, we are moving on to investigating the next location. Trading Post Kapstefna is right on the outskirts of Outpost Hilfalind, its a small trading post east / south east of Tapte Stjerner."
		},
		Summary = "Meet at Trading Post Kapstefna."
	},
	[63606] = {
		Title = "Episode Ragnarok",
		Description = {
			"The trading post is abandoned, there's not much left here. We need to move east towards Outpost Hilfalind."
		},
		Summary = "Meet at Outpost Hilfalind."
	},
	[63607] = {
		Title = "Episode Ragnarok",
		Description = {
			"Search Outpost Hilfalind, there has to be something to explain where the attack came from, regretfully due to the time passed and the snow, finding tracks is out of the question."
		},
		Summary = "Search the Outpost."
	},
	[63608] = {
		Title = "Episode Ragnarok",
		Description = {
			"Aslaug and Magnus former comrades have been turned into Draugr and are unable to dispose of them. Dispatch their former comrades to release them from undeath."
		},
		Summary = "Hunt 40 Draugr."
	},
	[63609] = {
		Title = "Episode Ragnarok",
		Description = {
			"Aslaug and Magnus are survivors of the attack that devastated the settlement, according to them the attack came from the north, from a place called The Frozen Caverns. We are going to travel north and meet inside of the cavern, there's a meeting point there."
		},
		Summary = "Go to The Frozen Caverns."
	},
	[63610] = {
		Title = "Episode Ragnarok",
		Description = {
			"This is where the wolves who sacked the settlement came from, we might find something in the deepest part of the cavern, we should go there and investigate."
		},
		Summary = "Search the caverns."
	},
	[63611] = {
		Title = "Episode Ragnarok",
		Description = {
			"The rest of the team got sucked into another dimension by the two bigger wolves, I need to survive this ordeal and look for them, I should wait for them at the meeting point near the entrance after I take care of my opponent."
		},
		Summary = "Survive, then find the others."
	},
	[63612] = {
		Title = "Episode Ragnarok",
		Description = {
			"We need to search for the lair of The Moon Slayer, we can't allow that wolf to continue it's rampage. Lief says The Moon Slayer is going east, I remember an eastward path from Outpost Hilfalind, that might be a good place to start. We're all splitting up to find it, whoever finds it should send up a signal flare to alert the rest of the team."
		},
		Summary = "Find the The Moon Slayer."
	},
	[63613] = {
		Title = "Episode Ragnarok",
		Description = { "Enter The Moon Slayer's lair and find where The Moon Slayer went." },
		Summary = "Enter the lair."
	},
	[63614] = {
		Title = "Episode Ragnarok",
		Description = {
			"There is a power well in the center of the cavern, something might happen if I interact with it."
		},
		Summary = "Check with the power well."
	},
	[63615] = {
		Title = "Episode Ragnarok",
		Description = { "Defeat The Moon Slayer in combat." },
		Summary = "Defeat The Moon Slayer."
	},
	[63616] = {
		Title = "Episode Ragnarok",
		Description = {
			"We just defeated The Moon Slayer, seems we've taken care of the threat in The Frozen Lands, we should head back to the landing zone and speak with Muwuse to prepare our flight back to the Kingdom."
