		},
		Summary = "Use the Gang Plank teleporter."
	},
	[63628] = {
		Title = "Episode Ragnarok",
		Description = {
			"The Umbala Guide just informed us that a Giant Wolf just went straight for Yggdrasil, seems to have done some damage to the Umbala village as well. We should head to the base of Yggdrasil to see what we can do."
		},
		Summary = "Go to Yggdrasil."
	},
	[63629] = {
