		},
		Summary = "Fight Lief again."
	},
	[63650] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"There's a Cupid in town who goes by Derpy, seems like he's in need of some help."
		},
		Summary = "Help Derpy in Prontera."
	},
	[63651] = {
		Title = "The Unfortunate Cupid",
