		},
		Summary = "Check on Shades in Prontera."
	},
	[63653] = {
		Title = "The Unfortunate Cupid",
		Description = { "Martha is in a panick, Derpy really caused quite a mess here." },
		Summary = "Report back to Derpy regarding Martha."
	},
	[63654] = {
		Title = "The Unfortunate Cupid",
