		},
		Summary = "Talk to Aaron Smith in Prontera."
	},
	[63656] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I'm helping Aaron acquire fireworks from the local traveling Pyrotechnician named Katie Kaboom, she's here in Prontera now."
		},
		Summary = "Talk to Katie Kaboom."
	},
	[63657] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I've agreed to help Katie acquire the items for trade on Aarons behalf, she wants 15 Green Plants."
		},
		Summary = "Obtain 15 Green Plants for Katie."
	},
	[63658] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I've completed the trade with Katie on Aaron's behalf, I should go check on Aaron, Katie sent him the package."
		},
		Summary = "Follow up with Aaron in Prontera."
	},
	[63659] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I'm going to head to the fields outside of the West exit of Prontera, there should be a lake out there, I need to ignite the fireworks that are set up on the southern shore for Aaron."
		},
		Summary = "Light Aaron's Fireworks."
	},
	[63660] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I lit the fireworks for Aaron, he should be out by the entrance to the Culverts somewhere near the north shore of here, I should go follow up with him."
		},
		Summary = "Find Aaron, west of Prontera."
	},
	[63661] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I should speak with Aaron back in Prontera again, he'll be paying me for my services."
		},
		Summary = "Follow up with Aaron in Prontera."
	},
	[63662] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I finished helping Aaron, per Derpy's request. I should follow up with Derpy in Prontera."
		},
		Summary = "Talk to Derpy Cupid in Prontera."
	},
	[63663] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"Derpy believes Shades is part of a criminal smuggling ring, he's hired me to obtain a ledger from their criminal hideout in South West Prontera and to bring it back to him so he can turn Shades into the Authorities."
		},
		Summary = "Obtain the Criminal Ledger."
	},
	[63664] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"Derpy wants me to get Lt. Don Tyler of the 1337th Elite Guard. He'll be in the new bar in East Prontera owned by one of their own members."
		},
		Summary = "Talk to Lt. Don Tyler."
	},
	[63665] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"Lt. Don said he'll find us after he gets his report ready, I should go back to Derpy and speak with him."
		},
		Summary = "Talk to Derpy Cupid in Prontera."
	},
	[63666] = {
		Title = "The Unfortunate Cupid",
		Description = { "Derpy wants me to follow up with Aaron and see how things are going." },
		Summary = "Talk to Aaron Smith in Prontera."
	},
	[63667] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I've been hired to gather Blue Bellflowers for Aaron Smith, these flowers can be found in Mt. Mjolnir Field 3."
		},
		Summary = "Gather Blue Bellflowers."
	},
	[63668] = {
		Title = "The Unfortunate Cupid",
		Description = {
			"I've been hired to gather Red Amaryllis for Aaron Smith, these flowers can be found in Mt. Mjolnir Field 3."
		},
		Summary = "Gather Red Amaryllis."
	},
